    data: |
      SELECT DISTINCT col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 * + + col0 = - 59 * + col1 * - - col1 / 77 + - - 55;
  - name: tab1

outputs:
  - name: q8367.out
    data: |
      14
      47
      5
